for (const item of items) {
  // Parse the JSON string in output
  const parsedOutput = JSON.parse(item.json.output);

  const brand = parsedOutput.brand;
  const type = parsedOutput["page type"];  // Note: space in key!

  if (!grouped[brand]) {
    grouped[brand] = {
      total: 0,
      distribution: {},
    };
  }

  grouped[brand].total += 1;
  grouped[brand].distribution[type] = (grouped[brand].distribution[type] || 0) + 1;
}

// Convert to output format n8n can handle
const results = [];

for (const brand in grouped) {
  const total = grouped[brand].total;
  const dist = grouped[brand].distribution;

  const percentages = {};
  for (const type in dist) {
    percentages[type] = ((dist[type] / total) * 100).toFixed(2) + "%";
  }

  results.push({
    json: {
      brand,
      total,
      distribution: dist,
      percentages,
    }
  });
}

return results;

