function decodeHtmlEntities(text) {
  return text
    .replace(/&lt;/g, "<")
    .replace(/&gt;/g, ">")
    .replace(/&quot;/g, '"')
    .replace(/&#039;/g, "'")
    .replace(/&amp;/g, "&");
}

function extractUrls(text) {
  const urlRegex = /https?:\/\/[^\s"'<>]+/g;
  return text.match(urlRegex) || [];
}

function isExternalLink(url) {
  // Skip Facebook, static.xx, CDN, image, script URLs, etc.
  const skipPatterns = [
    "facebook.com",
    "fbcdn.net",
    "static.xx.fbcdn.net",
    "scontent",
    ".jpg",
    ".png",
    ".css",
    ".js",
    ".svg",
    "doubleclick.net"
  ];
  return !skipPatterns.some(pattern => url.includes(pattern));
}

const rawHtml = $json["data"];
const decodedHtml = decodeHtmlEntities(rawHtml);
const allUrls = extractUrls(decodedHtml);

// Filter only clean external links
const filteredUrls = allUrls.filter(isExternalLink);

// Optional: Remove duplicates
const uniqueUrls = [...new Set(filteredUrls)];

